using System;
using System.Threading.Tasks;
using FluentAssertions;
using InstantMessenger.IntegrationTests.Api;
using InstantMessenger.IntegrationTests.Common;
using Xunit;

namespace InstantMessenger.IntegrationTests.Tests
{
    [Collection("Server collection")]
    public class AvatarChangeTest : IClassFixture<ServerFixture>
    {
        private readonly ServerFixture _fixture;

        public AvatarChangeTest(ServerFixture fixture)
        {
            _fixture = fixture;
        }

        [Fact]
        public async Task ChangeAvatar()
        {
            var token = await _fixture.LoginWithDefaultUser();
            var sut = _fixture.GetClient<IProfilesApi>();

            var result = await sut.ChangeAvatar(token.Token, TestImage());

            result.IsSuccessStatusCode.Should().BeTrue();
            var profile = await sut.Get($"Bearer {token.Token}");
            profile.Avatar.Should().NotBeNullOrWhiteSpace();
        }

        private static byte[] TestImage() => Convert.FromBase64String("");
    }
}